        style={{
          display: "grid",
          gridTemplateColumns: "1fr",
          gridTemplateRows: "1fr 1fr",
          gridTemplateAreas: `"desc" "title" "sum"`,
        }}
      >
        <div
          style={{
            borderRadius: "50%",
            height: 20,
            width: 20,
            backgroundColor: "black",
            display: "flex",
            alignItems: "center",
            gridArea: "desc",
